import React from "react";

function ConfirmPopUp({ hidePopUp, handleSubmit }) {
  return (
    <div className="confirm-pop-up">
      <div className="confirm-pop-up-content">
        <h2>Everything Looks Good?</h2>
        <p>I am confirm pop-up</p>
        <p>I confirming details</p>
        <button onClick={hidePopUp}>CANCEL</button>
        <button onClick={handleSubmit}>YES STAMP AWAY</button>
      </div>
    </div>
  );
}

export default ConfirmPopUp;
